//pages/Nav.js
import React from "react";
import './headerMain.css';
function headerMain() {
  return (

    

    <div id="HeadLine">
      <div id="Logo">
        <div id="logo-img"></div>
      </div>
      <div id="utilities">
        <div id="weatherCast"></div>
        <div id="search"></div>
        <div id="login"></div>
        <div id="mypage"></div>
      </div>
    </div>
  );
}

export default headerMain;


